<div class="entities" style="line-height: 2.5; direction: ltr">Translational PK-PD modelling of molecular target modulation for the AMPA receptor positive allosteric modulator Org 26576 . INTRODUCTION : The α-amino - 3 - hydroxy - 5 - methylisoxazole - 4 - propionic acid ( AMPA ) receptor potentiator Org 26576 represents an interesting pharmacological tool to evaluate the utility of glutamatergic enhancement towards the treatment of psychiatric disorders . In this study , a rat-human translational pharmacokinetic-pharmacodynamic ( PK-PD ) model of AMPA receptor modulation was used to predict human target engagement and inform dose selection in efficacy clinical trials . METHODS : Modelling and simulation was applied to rat plasma and cerebrospinal fluid ( 
<mark class="entity" style="background: linear-gradient(90deg, #333366, #ffffff); padding: 0.45em 0.6em; margin: 0 0.25em; line-height: 1; border-radius: 0.35em;">

</mark>
 ) pharmacokinetic and pharmacodynamic measurements to identify a target concentration ( EC (8 0 ) ) for AMPA receptor modulation . Human plasma pharmacokinetics was determined from 33 healthy volunteers and eight major depressive disorder patients . From four out of these eight patients , 
<mark class="entity" style="background: linear-gradient(90deg, #333366, #ffffff); padding: 0.45em 0.6em; margin: 0 0.25em; line-height: 1; border-radius: 0.35em;">
    P04141
    <span style="font-size: 0.8em; font-weight: bold; line-height: 1; border-radius: 0.35em; text-transform: uppercase; vertical-align: middle; margin-left: 0.5rem">REA</span>
</mark>
 PK was also determined . Simulations of human 
<mark class="entity" style="background: linear-gradient(90deg, #333366, #ffffff); padding: 0.45em 0.6em; margin: 0 0.25em; line-height: 1; border-radius: 0.35em;">
    P04141
    <span style="font-size: 0.8em; font-weight: bold; line-height: 1; border-radius: 0.35em; text-transform: uppercase; vertical-align: middle; margin-left: 0.5rem">REA</span>
</mark>
 levels were performed for several doses of Org 26576 . RESULTS : Org 26576 ( 0.1- 10 mg / kg , i . v . ) potentiated rat hippocampal AMPA receptor responses in an exposure-dependant manner . The rat plasma and 
<mark class="entity" style="background: linear-gradient(90deg, #333366, #ffffff); padding: 0.45em 0.6em; margin: 0 0.25em; line-height: 1; border-radius: 0.35em;">
    P04141
    <span style="font-size: 0.8em; font-weight: bold; line-height: 1; border-radius: 0.35em; text-transform: uppercase; vertical-align: middle; margin-left: 0.5rem">REA</span>
</mark>
 PK data were fitted by one-compartment model each . The rat 
<mark class="entity" style="background: linear-gradient(90deg, #333366, #ffffff); padding: 0.45em 0.6em; margin: 0 0.25em; line-height: 1; border-radius: 0.35em;">

 PK-PD model yielded an EC (8 0 ) value of 593 ng / ml ( 90 % confidence interval 406.8 , 1,264 . 1 ) . The human plasma and 
<mark class="entity" style="background: linear-gradient(90deg, #333366, #ffffff); padding: 0.45em 0.6em; margin: 0 0.25em; line-height: 1; border-radius: 0.35em;">
    P04141
    <span style="font-size: 0.8em; font-weight: bold; line-height: 1; border-radius: 0.35em; text-transform: uppercase; vertical-align: middle; margin-left: 0.5rem">REA</span>

 PK data were simultaneously well described by a two-compartment model . Simulations showed that in humans at 100 mg QD ,

<div class="entities" style="line-height: 2.5; direction: ltr">Enhancement of cytotoxicity of natural product drugs against multidrug resistant variant cell lines of human head and neck squamous cell carcinoma and breast carcinoma by tesmilifene . N , N-diethyl - 2 - [ 4 - ( phenylmethyl ) phenoxyl ] ethanamine ( tesmilifene ) , a tamoxifen derivative with antihistamine activity , greatly enhanced the survival of doxorubicin-treated , advanced stage breast cancer patients in a phase III trial . However , the molecular basis of tesmilifene action is not firmly established . The effects of tesmilifene on activity of several anticancer drugs was investigated using human head and neck squamous cell carcinoma ( HNSCC ) and breast carcinoma cell lines as a model system . Multidrug resistant ( MDR ) variants of an HNSCC cell line , HN - 5a / V15e , and a breast carcinoma cell line , MCF - 7 / V25a , both highly overexpressed mdr 1 ( 
<mark class="entity" style="background: linear-gradient(90deg, #333366, #ffffff); padding: 0.45em 0.6em; margin: 0 0.25em; line-height: 1; border-radius: 0.35em;">
    P08183
    <span style="font-size: 0.8em; font-weight: bold; line-height: 1; border-radius: 0.35em; text-transform: uppercase; vertical-align: middle; margin-left: 0.5rem">REA</span>
</mark>
 ) mRNA and the proteins P-glycoprotein and glutathione transferase-pi . Drug sensitivities were measured by a vital stain after 4 days of continuous exposure to anticancer drug in the absence and presence of tesmilifene at a concentration that alone had no antiproliferative effect . 
<mark class="entity" style="background: linear-gradient(90deg, #CC9966, #ffffff); padding: 0.45em 0.6em; margin: 0 0.25em; line-height: 1; border-radius: 0.35em;">

</mark>
 had minimal effect on drug cytotoxicity against the parental cell lines . However , the same tesmilifene treatment enhanced cytotoxicity of docetaxel , paclitaxel , epirubicin , doxorubicin , and vinorelbine against both MDR cell lines by up to 50 % . Flow cytometric measurement of annexin V / propidium iodide staining demonstrated that tesmilifene increased the killing of HN - 5a / V15e cells caused by docetaxel after 24 and 48h exposure . 
<mark class="entity" style="background: linear-gradient(90deg, #CC9966, #ffffff); padding: 0.45em 0.6em; margin: 0 0.25em; line-height: 1; border-radius: 0.35em;">

 increased accumulation of radiolabelled vincristine in HN - 5a / V15e cells , over 4h , by up to 100 % . The results suggest that tesmilifene might be effective in the treatment of tumors that are resistant to natural product drugs . The mechanism of enhancement appears to be related to expression of an ABC pump-dependent , MDR phenotype .</div>
